import React, { useEffect, useState } from "react";
import "./pages.css";
import { TabList, Tab, Widget, Tag, Table, Form } from "web3uikit";
import { useNativeBalance } from "react-moralis";


const Home = () => {

  const { getBalances, data: balance, nativeToken, error, isLoading } = useNativeBalance({ chain : "ropsten" });
  

  return (
    <>
      <div className="content">
        {balance.formatted}
        <TabList defaultActiveKey={1} tabStyle="bulbUnion">
          <Tab tabKey={1} tabName="DAO"></Tab>
          <Tab tabKey={2} tabName="FORUM"></Tab>
          <Tab tabKey={3} tabName="DOCS"></Tab>
        </TabList>
      </div>
    </>
  );
};

export default Home;
